import header from '../assets/graphics/graphics-header.svg';
import footer from '../assets/graphics/graphics-footer.svg';
import bag from '../assets/graphics/bag.svg';
import '../App.css';

function Menu()
{
    return (
        <div class="Menu">
            <button class="bag"><img src={bag}></img></button>
            <button class="button3">+</button>
            <img class="Header" src={header}></img>
            <img class="Footer" src={footer}></img>
        </div>

    )
}
export default Menu;
